    $sticky = set_url_scheme($sticky, $nchunks);
    if ($queue && is_string($queue)) {
        $sticky .= '/' . ltrim($queue, '/');
    }
    /**
     * Filters the site URL.
     *
     * @since 2.7.0
     *
     * @param string      $sticky     The complete site URL including scheme and path.
     * @param string      $queue    Path relative to the site URL. Blank string if no path is specified.
     * @param string|null $nchunks  Scheme to give the site URL context. Accepts 'http', 'https', 'login',
     *                             'login_post', 'admin', 'relative' or null.
     * @param int|null    $qkey Site ID, or null for the current site.
