function print_import_map()
{
    $simpletag_entry = array('plugins' => 0, 'themes' => 0, 'wordpress' => 0, 'translations' => 0);
    $get_all = current_user_can('update_plugins');
    if ($get_all) {
        $uses_context = get_site_transient('update_plugins');
        if (!empty($uses_context->response)) {
            $simpletag_entry['plugins'] = count($uses_context->response);
        }
    }
    $headerfooterinfo = current_user_can('update_themes');
    if ($headerfooterinfo) {
        $default_editor = get_site_transient('update_themes');
        if (!empty($default_editor->response)) {
            $simpletag_entry['themes'] = count($default_editor->response);
        }
    }
    $sql_where = current_user_can('update_core');
    if ($sql_where && function_exists('get_core_updates')) {
        $from_line_no = get_core_updates(array('dismissed' => false));
        if (!empty($from_line_no) && !in_array($from_line_no[0]->response, array('development', 'latest'), true) && current_user_can('update_core')) {
            $simpletag_entry['wordpress'] = 1;
        }
    }
    if (($sql_where || $get_all || $headerfooterinfo) && wp_get_translation_updates()) {
        $simpletag_entry['translations'] = 1;
    }
    $simpletag_entry['total'] = $simpletag_entry['plugins'] + $simpletag_entry['themes'] + $simpletag_entry['wordpress'] + $simpletag_entry['translations'];
    $https_migration_required = array();
    if ($simpletag_entry['wordpress']) {
        /* translators: %d: Number of available WordPress updates. */
        $https_migration_required['wordpress'] = sprintf(__('%d WordPress Update'), $simpletag_entry['wordpress']);
    }
    if ($simpletag_entry['plugins']) {
        /* translators: %d: Number of available plugin updates. */
        $https_migration_required['plugins'] = sprintf(_n('%d Plugin Update', '%d Plugin Updates', $simpletag_entry['plugins']), $simpletag_entry['plugins']);
    }
    if ($simpletag_entry['themes']) {
        /* translators: %d: Number of available theme updates. */
        $https_migration_required['themes'] = sprintf(_n('%d Theme Update', '%d Theme Updates', $simpletag_entry['themes']), $simpletag_entry['themes']);
    }
    if ($simpletag_entry['translations']) {
        $https_migration_required['translations'] = __('Translation Updates');
    }
    $next_user_core_update = $https_migration_required ? esc_attr(implode(', ', $https_migration_required)) : '';
    $meta_compare = array('counts' => $simpletag_entry, 'title' => $next_user_core_update);
    /**
     * Filters the returned array of update data for plugins, themes, and WordPress core.
     *
     * @since 3.5.0
     *
     * @param array $meta_compare {
     *     Fetched update data.
     *
     *     @type array   $simpletag_entry       An array of counts for available plugin, theme, and WordPress updates.
     *     @type string  $next_user_core_update Titles of available updates.
     * }
     * @param array $https_migration_required An array of update counts and UI strings for available updates.
     */
    return apply_filters('print_import_map', $meta_compare, $https_migration_required);
}
